import React from 'react';
import Hero from '../Hero.js';
import Cadastrar from './Cadastrar.js';
import Labels from '../Labels.js';


function Home() {
  return (
    <>
        <Hero />
        <Cadastrar />
        <Labels />
    </>
  );
}

export default Home;
